import React from 'react';

import { Container, Tag, LeftContainer, RightContainer, DeleteIcon, EditIcon } from './styles';

import './styles.ts';

interface IHistoryFinanceCardProps {
    tagColor: string;
    title: string;
    subtitle: string;
    amount: string;
}

const handleItemDelete = () => {
}

const handleItemEdit = () => {
}

const HistoryFinanceCard: React.FC<IHistoryFinanceCardProps> = ({
    tagColor,
    title,
    subtitle,
    amount
}) => (
    <Container>
        <Tag color={tagColor} />
        <RightContainer>
            <span>{title}</span>
            <small>{subtitle}</small>
        </RightContainer>
        <LeftContainer>
            <h3>{amount}</h3>
            <EditIcon onClick={handleItemEdit}/>
            <DeleteIcon onClick={handleItemDelete}/>
        </LeftContainer>
    </Container>
);

export default HistoryFinanceCard;
